import React, { Component } from 'react';
import questions from './components/questions';
import './App.css';

class App extends Component {
  render() {
      render (
          <div className="App">
              <div className="App-header">

                  <h2>React Quiz</h2>
              </div>
              <questions content="What is your favourite food?" />
          </div>
      );
  }
}

export default App;
